import { useAuth } from "react-oidc-context";
import Button, { LoginLogoutButton } from "../components/input/Button";
import UserRoleSwitcherContext from "../providers/user-role-switcher/UserRoleSwitcherContext";
import {DropdownMenu} from "../components/display";
import { DropdownHeader, DropdownItem } from "../components/display/DropdownMenu";
import { UserRoleType } from "../providers/user-role-switcher/UserRoleSwitcherProvider";
import ModuleNavBar from "./ModuleNavBar";
import { UserRole } from "../client";

function Header() {
    const auth = useAuth();
    console.log("building header")
    const width=205*0.45
    const height=117*0.45

    return <UserRoleSwitcherContext.Consumer>
        {value => { 
            const roleHeader = <DropdownHeader>Switch Role</DropdownHeader>
            const rawRoles = value.switchableRoles;
            const listRoles = rawRoles.map((role: UserRoleType) => {
                return <DropdownItem
                    onClick={()  => {value.setActiveRole(role);}}
                >
                    {role}
                </DropdownItem>
            });
            const roleMenu = value.switchableRoles.length > 0 ? <>{roleHeader}{listRoles}<hr className="h-0 my-2 border border-solid border-t-0 border-gray-700 opacity-25" /></> : <></>
            const loginLogoutButton = auth.isAuthenticated ? <></> : <LoginLogoutButton />;

            const dropdownMenu = <DropdownMenu ariaLabel="profileDropdown">
                {roleMenu}
                 <DropdownItem
                    onClick={()  => {auth.signoutRedirect();}}
                >
                    Log Out
                </DropdownItem>
            </DropdownMenu>;

            return (
            <header className="bg-white px-2 sm:px-4 py-2.5 fixed w-full z-20 top-0 left-0 border-b border-gray-200 dark:border-gray-600 dark:bg-gray-900">
                {/* <nav className="flex flex-wrap justify-between items-center mx-auto max-w-screen-xl px-4 md:px-6 py-2.5"> */}
                <nav className="flex flex-wrap justify-between items-center mx-auto max-w-screen-xl px-4 md:px-6">
                    <a href="#" className="flex items-center">
                        <svg width={width} height={height} viewBox={"0 0 "+width +" " + height} preserveAspectRatio="xMidYMid meet" fill="none" xmlns="http://www.w3.org/2000/svg" xmlnsXlink="http://www.w3.org/1999/xlink">
                            <rect width={width} height={height} fill="url(#pattern0)"/>
                            <defs>
                                <pattern id="pattern0" patternContentUnits="objectBoundingBox" width="1" height="1">
                                    <use xlinkHref="#image0_177_276" transform="matrix(0.00120408 0 0 0.0021097 -0.0418339 0)"/>
                                </pattern>
                                <image id="image0_177_276" width="900" height="474" xlinkHref="data:image/png;base64,"/>
                            </defs>
                        </svg>
                        {/* <span className="self-center text-xl font-semibold whitespace-nowrap dark:text-white">PVD</span> */}
                    </a>
                    <div className="flex md:order-2">
                        {/* <div className="self-center text-xs font-medium whitespace-nowrap dark:text-white">{auth.user?.profile.preferred_username}</div> */}
                        <div className="dropdown my-auto">
                            {auth.isAuthenticated? 
                            <><button
                                // purpose={"link"}  
                                className="dropdown-toggle normal-case flex items-center text-sm font-medium text-gray-900 rounded-full hover:text-blue-600 dark:hover:text-blue-500 md:mr-0 focus:ring-1 focus:ring-gray-100 dark:focus:ring-gray-700 dark:text-white pr-2" 
                                data-bs-toggle="dropdown"
                                aria-expanded="false"
                                id="profileDropdown"
                            >
                                <div className="relative inline-flex items-center justify-center w-10 h-10 overflow-hidden bg-gray-100 rounded-full dark:bg-gray-800">
                                    <span className="font-medium text-gray-600 dark:text-gray-300">{
                                        auth.user?.profile?.given_name?.charAt(0) ?? "" +
                                        auth.user?.profile?.family_name?.charAt(0) ?? ""
                                    }</span>
                                </div>
                                <div className="pl-2 font-small">{auth.user?.profile.name} 
                                {/* ({value.activeRole}) */}
                                </div>
                                <svg className="w-4 h-4 mx-1.5" aria-hidden="true" fill="currentColor" viewBox="0 0 20 20" xmlns="http://www.w3.org/2000/svg"><path fill-rule="evenodd" d="M5.293 7.293a1 1 0 011.414 0L10 10.586l3.293-3.293a1 1 0 111.414 1.414l-4 4a1 1 0 01-1.414 0l-4-4a1 1 0 010-1.414z" clip-rule="evenodd"></path></svg>
                            </button>
                            {dropdownMenu}</>
                            :<></>}
                            {loginLogoutButton}
                        </div>
                    </div>

                    {auth.isAuthenticated? <ModuleNavBar/>:<></>} 

                </nav>
                
            </header>
         
            )
        }}
    </UserRoleSwitcherContext.Consumer>;
}

export default Header;